import React, {lazy, Suspense} from 'react';
import logo from './logo.svg';
import './App.css';
import {Router, Route} from "react-router-dom";
import MenuAppBar from "./Components/AppBar"
import {createBrowserHistory} from 'history';
import {LoginProvider} from "./Utils/StateManagement";
//import App1 from './irisacomponents/src/AppMain'
import App1 from './Components/IrisaComponents/TextField/FormTextField'
//import App1 from './Components/IrisaComponents/Outcome/FormOutcome'
//import App1 from './Components/IrisaComponents/Button/FormButton'
import {Grid,Card} from '@material-ui/core';

const history = createBrowserHistory();
const Index = lazy(() => import('./Components/Index'));
const Users = lazy(() => import('./Components/Users'));
const Home = lazy(() => import('./Components/Home'));

/**
 * Main File
 * @returns {*}
 * @constructor
 */
function App() {

    /**
     * initial first states for authentication
     * @type {{authenticated: boolean}}
     */
    const initialAuthState = {
        authenticated: false
    };

    function move(event) {
        var k = event.keyCode,
            chrId = document.getElementById('test'),
            chr = {
                updown: function () {
                    var y = parseInt(getComputedStyle(chrId).top);
                    if (k == 38) {
                        --y;
                    } else if (k == 40) {
                        ++y;
                    }

                    return y;
                },

                leftright: function () {
                    var x = parseInt(getComputedStyle(chrId).left);
                    if (k == 37) {
                        --x;
                    } else if (k == 39) {
                        ++x;
                    }

                    return x;
                }
            };

        chrId.style.top = (chr.updown()) + "px";
        chrId.style.left = (chr.leftright()) + "px";
        }


    const TestComp =()=> (                                   
        <div style={ {
            "width": "100%",
            "height": "250px",
          }}>
        <div  spacing={0}>

            <div  className="col-md-12" > 
             <input  type='TEXT' value="main text" />
            </div> 

            <div item md={6}>
            <input type='TEXT' value="text 1" />
            </div>
            <div item md={6}>
            <input type='TEXT' value="text 2" />
            </div>

            <div item md={6}>
            <input type='TEXT' value="text 3" />
            </div>
            <div item md={6}>
            <input type='TEXT' value="text 4" />
            </div>

            <button></button>

        </div>
        </div> 
    );

    /**
     * create Reducer for authentication context
     * @param state
     * @param action
     * @returns {*}
     * @constructor
     */
    const AuthenticationReducer = (state, action) => {
        switch (action.type) {
            case 'changeAuthenticate':
                return {
                    ...state,
                    authenticated: action.authenticated
                };

            default:
                return state;
        }
    };

    return (
        // <div className="App">
            <LoginProvider
                initialState={initialAuthState}
                reducer={AuthenticationReducer}>
                <Router history={history}>
                    <MenuAppBar history={history}/>
                    <header className="App-header">
                        <img src={logo} className="App-logo" alt="logo"/>
                        <p>
                            Edit <code>src/App.js</code> and save to reload.
                        </p>
                        <div>
                            <Suspense fallback={<div>Loading...</div>}>
                                <Route path="/" exact component={Index}/>
                                <Route path="/about/" component={Home}/>
                                <Route path="/testcomp/" component={                                    
                                    TestComp 
                                }/>
                                <Route path="/users/" component={Users}/>
                            </Suspense>
                        </div>
                    </header>
                </Router>
            </LoginProvider>
        // </div>
    );
}

export default App;
